prompt --application/shared_components/plugins/dynamic_action/com_pretius_apex_chart_export
begin
wwv_flow_api.create_plugin(
 p_id=>wwv_flow_api.id(40614175711369561729)
,p_plugin_type=>'DYNAMIC ACTION'
,p_name=>'COM.PRETIUS.APEX.CHART_EXPORT'
,p_display_name=>'Pretius APEX Chart Export'
,p_category=>'INIT'
,p_supported_ui_types=>'DESKTOP'
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'function initialize_chart_export (',
'    p_dynamic_action in apex_plugin.t_dynamic_action,',
'    p_plugin         in apex_plugin.t_plugin )',
'return apex_plugin.t_dynamic_action_render_result is',
'  v_result apex_plugin.t_dynamic_action_render_result;',
'begin',
'  if apex_application.g_debug then',
'    apex_plugin_util.debug_dynamic_action(p_plugin         => p_plugin,',
'                                          p_dynamic_action => p_dynamic_action);',
'  end if;',
'  ',
'  apex_css.add_file (',
'    p_name => ''jquery.contextMenu'',',
'    p_directory => p_plugin.file_prefix',
'  );',
'  ',
'  apex_javascript.add_library(',
'    P_NAME                  => ''jquery.contextMenu'',',
'    P_DIRECTORY             => p_plugin.file_prefix,',
'    P_CHECK_TO_ADD_MINIFIED => true,',
'    P_KEY                   => ''jquerycontextmenu''',
'  );',
'',
'  apex_javascript.add_library(',
'    P_NAME                  => ''jquery.ui.position'',',
'    P_DIRECTORY             => p_plugin.file_prefix,',
'    P_CHECK_TO_ADD_MINIFIED => true,',
'    P_KEY                   => ''jqueryuiposition''',
'  );',
'',
'  apex_javascript.add_library(',
'    P_NAME                  => ''saveSvgAsPng'',',
'    P_DIRECTORY             => p_plugin.file_prefix,',
'    P_CHECK_TO_ADD_MINIFIED => true,',
'    P_KEY                   => ''savesvgaspng''',
'  );',
'',
'  apex_javascript.add_library(',
'    P_NAME                  => ''pretius.apex.chartExport'',',
'    P_DIRECTORY             => p_plugin.file_prefix,',
'    P_CHECK_TO_ADD_MINIFIED => true,',
'    P_KEY                   => ''pretiusapexchartexport''',
'  );',
'  ',
'  v_result.javascript_function := ''pretiusChartExport.exportChart()'';',
'',
'  return v_result;',
'end;'))
,p_api_version=>2
,p_render_function=>'initialize_chart_export'
,p_standard_attributes=>'ONLOAD'
,p_substitute_attributes=>true
,p_subscribe_plugin_settings=>true
,p_help_text=>'<p>This plugin enables users to export Oracle JET charts to PNG files.</p>'
,p_version_identifier=>'1.0'
,p_files_version=>40
);
end;
/
